import styled from "styled-components";

export const Table = styled.div`
  display: flex;
  justify-content: flex-start;
  align-items: center;
  flex-direction: column;
  width: fit-content;
  color: black;
`;

export const Cell = styled.div`
  display: flex;
  align-items: center;
`;
